# Translating RNA into Protein

from Bio.Seq import Seq    # using biopython


s = "" # Define the RNA sequence as a string 

# Create a Biopython Seq object for the RNA sequence
rna_sequence = Seq(s)

# Translating the RNA sequence into a protein sequence
protein_sequence = rna_sequence.translate()

# Print the resulting protein sequence
print(protein_sequence)